item.description:
 &lt;h1 id=&#34;注解requiredargsconstructor详解&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#注解requiredargsconstructor详解&#34;&gt;#&lt;/a&gt; 注解 @RequiredArgsConstructor 详解&lt;/h1&gt;
&lt;p&gt;&lt;strong&gt;作用&lt;/strong&gt;：忽略某些字段生成构造器&lt;/p&gt;
&lt;p&gt;Lombok 提供的 @RequiredArgsConstructor 方式（会生成一个包含常量，和标识了 NotNull 的变量的构造方法）&lt;br /&gt;
在 springboot 项目中，controller 或 service 层中需要注入多个 mapper 接口或者另外的 service 接口，这时候代码中就会有多个 @AutoWired 注解，使得代码看起来什么的混乱。&lt;br /&gt;
&lt;strong&gt;lombok 提供了一个注解&lt;/strong&gt;：&lt;br /&gt;
@RequiredArgsConstructor(onConstructor =@_(@Autowired))&lt;br /&gt;
 写在类上面可以代替 @AutoWired 注解，&lt;mark&gt;需要注意的是&lt;/mark&gt;：在注入的时候需要用 final 定义，或者使用 @notnull 注解&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/image-20240316212600141.png&#34; alt=&#34;image-20240316212600141&#34; /&gt;&lt;/p&gt;
